import Link from "next/link";

const Card = ({ name, title, imgsrc, imgalt, strbody, btncaption }) => (
  <div className="card">
        <div className="card-header">{name}</div>
    <img className="card-img-top" src={imgsrc} alt={imgalt} />
    <div className="card-body">
      <h5 className="card-title">{title}</h5>
      <p className="card-text">{strbody}</p>

      <Link href="/contact">
        <a className="btn btn-outline-primary">{btncaption}</a>
      </Link>
    </div>
  </div>
);

export default Card;
